import React from 'react';
import './App.css';
import Logged from './components/Logged';

// import {
//   BrowserRouter as Router,
//   Route,
//   Link
// } from 'react-router-dom'


export default class App extends Component {
  static state={
    title:['Critical Hit'],
    url:['http://placehold.it/300x300'],
    train_score:[0.8],
    test_score:[0.9],
  }
  render() {
    return (
      <div>
      <nav className='bg-dark navbar-expand-lg text-right p-1'>
        <a href="#null" className=''>Login</a>
      </nav>
      <Logged url={state.url} title={state.title} train_score={state.train_score} test_score={state.test_score} />
      </div>
    )
  }
}
